# ---------------------------------------- AI model detail view tests ----------------------------------------
class AimodelDetailedViewTests(TestCase):

	def setUp(self):
		self.user = User.objects.create_user(
			username='testuser123',
			email='test123@email.com',
			password='TestPassword1234'
		)

		self.aimodel = AIModel.objects.create(
			name='New Test Model',
			general_description='General Description',
			image='image test',
			input_example='Input Example test',
			input_type='Number',
			library='Library',
			output_example='Output Example test',
			output_type='Number',
			ai_model_structure='Ai model structure test',
			requirements='Requirements test',
			technical_description='Technical Description test',
			preprocess_code='Preprocess Code test',
			postprocess_code='Postprocess Code test',
			api_url='https://aitomic.net/model/test',
			price_hundred_calls=0.1,
			monthly_calls=500,
			rating=5,
			final_mode=True,
			tags='tag 1 test, tag 2 test, tag 3 test',
			provider=self.user
		)

	def test_string_representation(self):
		aimodel = AIModel(name='New Test Model')
		self.assertEqual(str(aimodel), aimodel.name)

	def test_aimodel_content(self):
		self.assertEqual(f'{self.aimodel.name}', 'New Test Model'),
		self.assertEqual(f'{self.aimodel.general_description}', 'General Description'),
		self.assertEqual(f'{self.aimodel.image}', 'image test'),
		self.assertEqual(f'{self.aimodel.input_example}', 'Input Example test'),
		self.assertEqual(f'{self.aimodel.input_type}', 'Number'),
		self.assertEqual(f'{self.aimodel.output_example}', 'Output Example test'),
		self.assertEqual(f'{self.aimodel.output_type}', 'Number'),
		self.assertEqual(f'{self.aimodel.ai_model_structure}', 'Ai model structure test'),
		self.assertEqual(f'{self.aimodel.requirements}', 'Requirements test'),
		self.assertEqual(f'{self.aimodel.technical_description}', 'Technical Description test'),
		self.assertEqual(f'{self.aimodel.preprocess_code}', 'Preprocess Code test'),
		self.assertEqual(f'{self.aimodel.postprocess_code}', 'Postprocess Code test'),
		self.assertEqual(f'{self.aimodel.api_url}', 'https://aitomic.net/model/test'),
		self.assertEqual(self.aimodel.price_hundred_calls, 0.1),
		self.assertEqual(self.aimodel.monthly_calls, 500),
		self.assertEqual(self.aimodel.rating, 5),
		self.assertEqual(f'{self.aimodel.tags}', 'tag 1 test, tag 2 test, tag 3 test'),
		self.assertEqual(self.aimodel.provider, self.user)

	def test_aimodel_detail_view(self):
		response = self.client.get(f'/model/{self.aimodel.pk}/')
		# no_response = self.client.get('/model/0/')
		self.assertEqual(response.status_code, 200)
		# self.assertEqual(no_response.status_code, 404)
		self.assertContains(response, 'New Test Model')
		#self.assertEqual(response.context_data.aimodel.name, 'New Test Model')
		self.assertTemplateUsed(response, 'model_detail.html')


# ---------------------------------------- AI model form tests ----------------------------------------

class AIModelFormTestCase(TestCase):

	def test_correct_form(self):
		ai_model_structure = open('aitomic/test_files/ai_model_structure_test.json', 'rb')
		weights = open('aitomic/test_files/weights_test.h5', 'rb')
		bananas = open('aitomic/test_files/bananas.jpg', 'rb')

		post_dict = {'name': 'Test', 'general_description': 'Test', 'input_example': 'Test', 'input_type': 'Number',
					 'final_mode': True, 'has_trial': True, 'output_example': 'Test', 'output_type': 'Number',
					 'requirements_text': 'Test', 'technical_description': 'Test', 'preprocess_code_text': 'Test',
					 'postprocess_code_text': 'Test', 'library': 'Keras',
					 'price_hundred_calls': 1.0, 'monthly_calls': 3, 'tags': 'Test', 'measure': 3, 'value': 3}
		file_dict = {'ai_model_structure': SimpleUploadedFile(ai_model_structure.name, ai_model_structure.read()),
					 'weights': SimpleUploadedFile(weights.name, weights.read()),
					 'image': SimpleUploadedFile(bananas.name, bananas.read())}
		form = AIModelForm(post_dict, file_dict)
		print("Form errors:")
		print(form.errors)
		self.assertTrue(form.is_valid())

	def test_empty_name(self):
		ai_model_structure = open('aitomic/test_files/ai_model_structure_test.json', 'rb')
		weights = open('aitomic/test_files/weights_test.h5', 'rb')
		bananas = open('aitomic/test_files/bananas.jpg', 'rb')

		post_dict = {'name': None, 'general_description': 'Test', 'input_example': 'Test', 'input_type': 'Number',
					 'final_mode': True, 'has_trial': True, 'output_example': 'Test', 'output_type': 'Number',
					 'requirements_text': 'Test', 'technical_description': 'Test', 'preprocess_code_text': 'Test',
					 'postprocess_code_text': 'Test', 'library': 'Keras',
					 'price_hundred_calls': 1.0, 'monthly_calls': 3, 'tags': 'Test', 'measure': 3, 'value': 3}
		file_dict = {'ai_model_structure': SimpleUploadedFile(ai_model_structure.name, ai_model_structure.read()),
					 'weights': SimpleUploadedFile(weights.name, weights.read()),
					 'image': SimpleUploadedFile(bananas.name, bananas.read())}
		form = AIModelForm(post_dict, file_dict)

		self.assertFalse(form.is_valid())
		self.assertTrue('required' in str(form.errors['name']))



