class ListSearchModelTest(TestCase):

	def setUp(self):
		self.user = User.objects.create_user(
			username='testuser123',
			email='test123@email.com',
			password='TestPassword1234'
		)

		self.aimodel = AIModel.objects.create(
			name='New Test Model',
			general_description='General Description',
			image='image test',
			input_example='Input Example test',
			input_type='Number',
			library='Library',
			output_example='Output Example test',
			output_type='Number',
			ai_model_structure='Ai model structure test',
			requirements='Requirements test',
			technical_description='Technical Description test',
			preprocess_code='Preprocess Code test',
			postprocess_code='Postprocess Code test',
			api_url='https://aitomic.net/model/test',
			price_hundred_calls=0.1,
			monthly_calls=500,
			rating=5,
			final_mode=True,
			tags='tag 1 test, tag 2 test, tag 3 test',
			provider=self.user
		)

	def test_aimodel_list(self):
		response = self.client.get(f'/modelSearch/')
		self.assertEqual(response.status_code, 200)
		self.assertContains(response, 'New Test Model')
		self.assertTemplateUsed(response, 'model_search.html')


	def test_aimodel_search(self):
		# positive test Author= testuser123
		response = self.client.get(f'/modelSearch/?p_search=testuser123')
		self.assertEqual(response.status_code, 200)
		self.assertContains(response, 'New Test Model')
		self.assertTemplateUsed(response, 'model_search.html')
		# negative test Author = admin
		response = self.client.get(f'/modelSearch/?p_search=admin')
		self.assertEqual(response.status_code, 200)
		self.assertNotContains(response, 'New Test Model')
		self.assertTemplateUsed(response, 'model_search.html')
		# positive test name or tag or general description contains es
		response = self.client.get(f'/modelSearch/?p_search=es')
		self.assertEqual(response.status_code, 200)
		self.assertContains(response, 'New Test Model')
		self.assertTemplateUsed(response, 'model_search.html')
		# negative test name or tag or general description contains caca
		response = self.client.get(f'/modelSearch/?p_search=caca')
		self.assertEqual(response.status_code, 200)
		self.assertNotContains(response, 'New Test Model')
		self.assertTemplateUsed(response, 'model_search.html')
		# positive test min_price = 0 max_price = 1
		response = self.client.get(f'/modelSearch/?p_search=&min_price=0&max_price=1')
		self.assertEqual(response.status_code, 200)
		self.assertContains(response, 'New Test Model')
		self.assertTemplateUsed(response, 'model_search.html')
		# negative test min_price = 1 max_price = 2
		response = self.client.get(f'/modelSearch/?p_search=&min_price=1&max_price=2')
		self.assertEqual(response.status_code, 200)
		self.assertNotContains(response, 'New Test Model')
		self.assertTemplateUsed(response, 'model_search.html')
		# positive test rating=2
		response = self.client.get(f'/modelSearch/?p_search=&min_price=&max_price=&rating=2')
		self.assertEqual(response.status_code, 200)
		self.assertContains(response, 'New Test Model')
		self.assertTemplateUsed(response, 'model_search.html')
		# negative test rating=3
		response = self.client.get(f'/modelSearch/?p_search=&min_price=1&max_price=2')
		self.assertEqual(response.status_code, 200)
		self.assertNotContains(response, 'New Test Model')
		self.assertTemplateUsed(response, 'model_search.html')

#--------------------------------Test profile Model---------------------------------------#


class ProfileModelTest(TestCase):

	def setUp(self):
		self.user = User.objects.create_user(
			username='testuser123',
			email='test123@email.com',
			password='TestPassword1234'
		)

		profile = self.user.profile
		profile.birth_date = '1995-03-29',

		profile.photo = ''
		profile.email_confirmed = 'True',
		profile.description = 'Description user'

	def test_edit_profile_user(self):

		response = self.client.get(f'/myaccount/edit/')
		self.assertEqual(response.status_code, 302)
		self.client.login(username='testuser123', password='TestPassword1234')
		response = self.client.get(f'/myaccount/edit/')
		self.assertEqual(response.status_code, 200)
		self.assertEqual(f'{self.user.profile.description}', 'Description user')
		profile = self.user.profile
		profile.description = 'Description user modfied'

		self.assertEqual(f'{self.user.profile.description}', 'Description user modfied')
		self.assertTemplateUsed(response, 'profile/edit_account.html')
